PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?artist ?producer
WHERE {
  dbpedia:Chris_Taylor_(music_producer) dbo:associatedBand ?artist .
  ?work rdf:type dbo:MusicalWork ;
        rdf:type dbo:Song ;
        rdf:type dbo:Work ;
        dbo:producer ?producer ;
        dbo:author dbpedia:50_Cent .
}

PREFIX dbp: <http://dbpedia.org/property/>
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?spouse ?child
WHERE {
  dbr:Laodice_IV dbp:spouse ?spouse .
  ?successor dbo:successor dbr:Antiochus_II_Theos .
  FILTER EXISTS { ?successor dbo:occupation dbr:Monarchy . }
  ?child dbo:parent ?successor .
  FILTER EXISTS { ?child dbo:occupation dbr:Monarchy . }
  ?grandChild dbo:parent ?child .
  FILTER EXISTS { ?grandChild dbo:occupation dbr:Monarchy . }
}

SELECT ?party WHERE { 
  <http://dbpedia.org/resource/Michele_Pinto> dbp:party ?party .
}

SELECT ?child
WHERE {
  ?person dbo:birthName "Jon Pertwee" .
  ?person dbo:birthPlace dbr:London .
  ?person dbo:child ?child .
}

SELECT ?figure ?almaMater 
WHERE {
  ?awardee dcterms:subject dbc:Royal_Medal_winners .
  ?figure dbo:alumni ?almaMater .
  FILTER (?figure = dbpedia:Queen's_University_Belfast) .
}

SELECT ?alma_mater WHERE { 
  <http://dbpedia.org/resource/George_Kilbon_Nash> dbp:almaMater ?alma_mater .
}

SELECT ?claim_to_fame ?war 
WHERE {
  { 
    ?person dbo:birthPlace dbr:Gibraltar .
    ?person dbp:commands dbr:Great_Siege_of_Gibraltar .
    ?person rdfs:label ?claim_to_fame .
    ?person dbp:battles dbr:Peninsular_War .
    bind(?war as ?b)
  }
}

