  ?person dbo:award dbr:Knight_Grand_Cross_of_the_Order_of_St_Michael_and_St_George ;
           dbo:restingPlace ?restingPlace2 .
}

SELECT ?settlement WHERE {
  ?writer dbo:album dbr:Where_It's_At_(Dustin_Lynch_album) .
  ?university dbo:alumni dbr:Carl_L._Nippert .
  ?settlement dct:subject dbc:Administrative_divisions_of_Ohio .
