}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://dbpedia.org/property/>

SELECT ?deathPlace ?battleLocation ?partyHeadquarters
WHERE {
  OPTIONAL { 
    ?laura dbo:deathPlace ?deathPlace .
    FILTER (?laura = dbpedia:Laura_Mancinelli)
  }
  OPTIONAL { 
    ?battle dbo:location ?battleLocation .
    FILTER (?battle = dbpedia:Battle_of_Marengo)
  }
  OPTIONAL {
    ?party dbo:headquarters ?partyHeadquarters .
    FILTER (?party = dbpedia:Forza_Italia)
  }
}

SELECT ?alma_mater1 ?alma_mater2 
WHERE {
  OPTIONAL { 
    ?person1 dbo:alumniOf ?alma_mater1 .
    ?person1 rdfs:label "John Alderdice, Baron Alderdice"@en
    FILTER (LANGMATCHES(LANG(?alma_mater1), 'en'))
  } .
  OPTIONAL {
    ?person2 dbo:award dbr:Royal_Medal .
    ?person2 dbo:alumniOf ?alma_mater2 .
    ?person2 rdfs:label "QUB"@en
    FILTER (LANGMATCHES(LANG(?alma_mater2), 'en'))
  } 
}

SELECT ?item ?itemLabel 
WHERE 
{ 
    { 
        ?item wdt:P361 wd:Q5295688 .
        ?item wdt:P802 wd:Q131535 .
    } UNION { 
        ?item wdt:P361 wd:Q5295688 .
        ?item wdt:P802 wd:Q56247424 .
    }
    SERVICE wikibase:label { bd:serviceParam wikibase:language "en" }
}

SELECT ?war ?claim_to_fame 
WHERE {
  { 
    SELECT ?war ?claim_to_fame
    WHERE {
      ?person dbo:birthPlace dbr:Spain .
      ?person dbo:deathDate ?death_date .
      ?person rdfs:label "Joaquín Blake" .
      ?war dbo:commander ?person .
      ?war a dbo:MilitaryConflict, yago:SocietalEvent, schema:Event .
      ?claim_to_fame rdfs:label ?claim_to_fame_label .
      FILTER (LANGMATCHES(LANG(?claim_to_fame_label), "en")) 
    }
  }
  { 
    SELECT ?war ?claim_to_fame
    WHERE {
      ?person dbo:birthPlace dbr:Ireland .
      ?person rdfs:label "Thomas Trigge" .
      ?war dbo:commander ?person .
      ?war a dbo:MilitaryConflict, yago:SocietalEvent, schema:Event .
      ?claim_to_fame rdfs:label ?claim_to_fame_label .
      FILTER (LANGMATCHES(LANG(?claim_to_fame_label), "en")) 
    }
  }
}

SELECT ?party1 ?party2 
WHERE {
  { 
    ?alumnus dbo:alumniOf dbr:Massachusetts_Institute_of_Technology .
    ?father dbo:parentOf ?alumnus .
    ?father dbo:party ?party1
  } 
  UNION 
  { 
    dbr:Romano_Prodi dbo:party ?party2
  }
}

