SELECT ?actor
WHERE {
  ?person dbo:birthPlace dbpedia:London .
  ?person dbo:parent dbpedia:Jon_Pertwee .
  ?person rdfs:label "Sean Pertwee"@en .
  ?film dbo:starring ?person .
  ?film a dbo:Film .
  ?conflict a dbo:MilitaryConflict .
  ?person dbo:knownFor ?claimToFame .
  { 
    { ?claimToFame rdfs:label ?filmLabel . }
    UNION
    { ?claimToFame rdfs:label ?conflictLabel . }
  }
  FILTER (?filmLabel = ?claimToFame || ?conflictLabel = ?claimToFame)
}

SELECT ?parent1 ?parent2
