    BIND(EXISTS{ 
      ?SetiI dbo:child ?child1 .
      ?child1 dbo:child ?grandchild1 .
      ?grandchild1 dbo:parent ?parent2 .
    } AS ?hasParent2)
    ?SetiI dbo:child ?child1 .
    ?child1 dbo:child ?grandchild1 .
    ?grandchild1 dbo:parent ?parent2 .
  }
}

